import React from 'react';

function Projects() {
  return (
    <div>
      <h2>End-to-End Projects</h2>
      <ol>
        <li>Advanced End-to-End DevSecOps Project</li>
        <li>Deploy Three-Tier Application</li>
        <li>Terraform-AWS Project</li>
      </ol>
    </div>
  );
}

export default Projects;
